VALUES ('3270120582527', 'Couscous', 'Semoule de blé dur réhydratée cuisinée 35 % (eau, semoule de _blé_ dur huile d\'olive vierge extra, huile de tournesol, sel, poivre blanc), eau, émincés de nigts de poulet traités en salaison cuits 10 % (filets de poulet, eau, amidon ou fécule, dextrose, sel), courgettes 9 %, carottes 5 %, pois chiches 5 %, merguez précuite pelée 4 % (viande de bœuf, viande de mouton, gras de mouton, épices et plant. aromatiques, sel, dextrose, colorant: rouge de betterave, conservateur : nitrite de sodium), oignons 2 %, navets 2 %, tomate pelée concassée 2 % (tomate, jus de tomate, acidifiant acide citrique), double concentré de tomate 1%, poivron 1 %, poivron rouge 1%, huile d\'olive vierge extra, sel, fécule de pomme de terre, arôme naturel de légumes (contient _céleri_), arômes naturels (contient _lait_), mélange d\'épices Ras el-hanout (coriandre, curcuma, gingembre, girofle, poivre, fenugrec, cardamome, muscade, anis, cannelle, romarin, cumin), harissa (piment, coriandre, sel, carvi).', 'https://static.openfoodfacts.org/images/products/327/012/058/2527/front_fr.4.400.jpg', '4.2', '1', '12', '1.7', '', '6.8', '0.9', '0.354330708661417', '', '1');

