m en poudre, matière grasse laitière anhydre, pâte de cacao, lait écrémé en poudre, émulsifiants: lécithine de soja, polyricinoléate de polyglycérol), lait écrémé réhydraté, eau, crème liquide 12,4%, sucre, éclat d\'amande grillée 6,2%, sirop de glucose-fructose de blé, lactose et protéines de lait en poudre, émulsifiant: mono- et diglycérides d\'acides gras d\'origine végétale, épaississants (farine de graines de caroube, gomme de guar), arôme naturel de vanille 0,2%, vanille épuisée en poudre, colorant: rocou.', 'https://static.openfoodfacts.org/images/products/327/016/035/3224/front_fr.10.400.jpg', '13.6', '9.1', '20.5', '18.4', '0.6', '1.9', '0.1016', '0.04', '', '1');

